public static <T> Transform<T, Integer> year(Type type) {
  switch (type.typeId()) {
    case DATE:
      return (Transform<T, Integer>) Dates.YEAR;
    case TIMESTAMP:
      return (Transform<T, Integer>) Timestamps.YEAR;
    default:
      throw new IllegalArgumentException(
          "Cannot partition type " + type + " by year");
  }
}

